import { VALUE } from "../actions/itemAction";
import Home from "../../pages/index";

const reducer = (state = {time:0}, action) => {
	switch (action.type) {
		case VALUE:
			return {state, time: this.state.milliSecondsElapsed/100};
		default:
			return (state)
	}
};

export default reducer;
